<!doctype html>
<html>
<head>
  <meta charset="utf-8">
  <title>Jasmine Spec Runner</title>

  
  <link rel="stylesheet" type="text/css" href=".grunt/grunt-contrib-jasmine/jasmine.css">
  

  
  
  

  <script src=".grunt/grunt-contrib-jasmine/require.js"></script>

  
  
  <script src=".grunt/grunt-contrib-jasmine/jasmine.js"></script>
  
  <script src=".grunt/grunt-contrib-jasmine/jasmine-html.js"></script>
  
  <script src=".grunt/grunt-contrib-jasmine/json2.js"></script>
  
  <script src=".grunt/grunt-contrib-jasmine/boot.js"></script>
  
  

  <script>
    require.onError = function(error) {
      var message = error.requireType + ': ';
      if (error.requireType === 'scripterror' || error.requireType === 'notloaded' && error.requireModules) {
        message += 'Illegal path or script error: ' + '[\'' + error.requireModules.join("', '") + '\']';
      } else {
        message += error.message;
      }

      throw Error(message);
    };
  </script>

  <script>
    

    
      require.config({
  "deps": [
    "../.grunt/grunt-spec/collaborators",
    "../.grunt/grunt-spec/requirements",
    "collaborator/builder"
  ],
  "callback": function anonymous(collaborators,requirements,collaboratorBuilder
/**/) {

        require.config({
            map: collaboratorBuilder.createDependencyMap(collaborators, requirements)
        });
    
launchTest();
},
  "baseUrl": "src/",
  "specDirSrc": "src/",
  "specDirSpec": "spec/",
  "paths": {
    "collaborator": "/Users/jacker/Projects/collaborator/collaborator/collaborator",
    "spec-object": "/Users/jacker/Projects/collaborator/collaborator/spec-object",
    "spec-module": "/Users/jacker/Projects/collaborator/collaborator/spec-module",
    "spec-class": "/Users/jacker/Projects/collaborator/collaborator/spec-class",
    "collaborator/definer": "/Users/jacker/Projects/collaborator/collaborator/definer",
    "collaborators": "/Users/jacker/Projects/collaborator/collaborator/../.grunt/grunt-spec/collaborators",
    "requirements": "/Users/jacker/Projects/collaborator/collaborator/../.grunt/grunt-spec/requirements",
    "collaborator/builder": "/Users/jacker/Projects/collaborator/collaborator/builder"
  }
});
    
  </script>

  <script>
    // Delay onLoad function until we are ready
    var startTests = window.onload;
    window.onload = null;

    function launchTest() {
    require([
      
    ],
    function(){
      require(['spec/acme/Person.js','.grunt/grunt-contrib-jasmine/reporter.js'], function(){
        startTests();
      });
    }
    )
  }
  </script>

  
</head>

</body>
</html>
